import React from "react";
import "../../styles/index.css";

const MissionList = (props) => {
  console.log(props.missionList);
  return (
    <div className="py-5 px-4">
      <ul className="-my-5 divide-y divide-gray-200">
        {props.missionList.map((mission) => (
          <li key={mission.id} className="py-5">
            {console.log(mission) + console.log(Object.keys(mission))}
            <div className="grid grid-cols-6">
              <div className="min-w-0 col-span-5">
                {Object.keys(mission).map((key) => {
                  <p>{key} : {mission[key]}</p>
                })}
                <p className="truncate">Type : {mission.missionType.name}</p>
                <div className="flex flex-wrap">
                  <div className="mx-2">
                    <p>
                      {" "}
                      <b>Qty :</b> {mission.quantity}
                    </p>
                  </div>
                  <div>
                    <p> VINs : {mission.vins}</p>
                  </div>
                  <div>
                    <p> Pick-up address : {mission.pickUp}</p>
                  </div>
                  <div>
                    <p> Drop-off address : {mission.dropOff}</p>
                  </div>
                  <div>
                    <p> Fleet : {mission.fleet}</p>
                  </div>
                  <div>
                    <p> Comment : {mission.comment}</p>
                  </div>
                </div>
              </div>
              <div className="flex h-fit justify-center col-span-1">
                <a
                  href="#"
                  className=" shadow-sm px-2.5 py-0.5 border border-red-300 text-sm leading-5 font-medium rounded-full text-red-700 bg-white hover:bg-red-50"
                >
                  Delete
                </a>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};
export default MissionList;
